.project-manager-edit {
  display: flex;
  align-items: center;
  justify-content: center;
  background: #363430;
}
.project-manager-edit h1 {
  color: #d7dae0;
}
.project-manager-edit .input-label {
  font-size: 1.2em;
  display: inline-block;
  width: 35%;
}
.project-manager-edit .input-text {
  display: inline-block;
  width: 65%;
}
.project-manager input {
  width: 100%;
}
.project-manager [data-path-missing="true"] .primary-line,
.project-manager [data-path-missing="true"] .secondary-line {
  opacity: 0.4;
}
.project-manager [data-path-missing="true"] .secondary-line .icon:before {
  color: #e2c08d;
}
.project-manager-list-group {
  color: rgba(173, 170, 164, 0.6);
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: #403f3a;
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #adaaa4;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #ff6347;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
